int (*LevelTools_artistForAudio)(int);
int LevelTools_artistForAudio_H(int ID) {
  int aToS[36] = {3, 0, 4, 0, 0, 0, 1, 1, 0, 0, 1, 5, 1, 5, 5, 1, 1, 6, 7, 8, 1, 9, 10};
  if (ID == -1) return 2;
  if (ID > 23) return 0;
  return aToS[ID];
}

